import React from "react";
import "./Main.css";
import { Button, form } from "react-bootstrap";

const Home = () => {
  return (
    <div>
      <div className="lol">
        <Form className="d-flex">
          <Form.Control
            type="search"
            placeholder="Search"
            className="me-2"
            aria-label="Search"
          />
          <Button variant="outline-success">Search</Button>
        </Form>
      </div>
    </div>
  );
};

export default Home;
